import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import { AuthProvider } from './AuthContext';
import PrivateRoute from './PrivateRoute';

import LoginPage from './components/LoginPage';
import Signup from './components/Signup';
import HomePage from './components/HomePage';
import ChallengeDashboard from './components/ChallengeDashboard';
import PasswordCrackingChallenge from './components/PasswordCrackingChallenge';

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="app-container">
          <nav className="navbar">
            <ul>
              <li><Link to="/">Home</Link></li>
              <li><Link to="/signup">Sign Up</Link></li>
              <li><Link to="/login">Login</Link></li>
              <li><Link to="/challenge-dashboard">Challenges</Link></li>
            </ul>
          </nav>

          <div className="main-content">
            <Routes>
              <Route path="/" element={<HomePage />} />
              <Route path="/signup" element={<Signup />} />
              <Route path="/login" element={<LoginPage />} />
              <Route
                path="/challenge-dashboard"
                element={
                  <PrivateRoute>
                    <ChallengeDashboard />
                  </PrivateRoute>
                }
              />
              <Route
                path="/challenge/password-cracking"
                element={
                  <PrivateRoute>
                    <PasswordCrackingChallenge />
                  </PrivateRoute>
                }
              />
            </Routes>
          </div>
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
